import React, { Component } from "react";
import NavBar from "./NavBar";
import ListaDeClientes from "./Clientes";
import CarritoDeCompras from "./Carrito";
import Login from "./Login";
import Catalogo from "./Catalogo";
import { Route, Routes } from "react-router";
import { BrowserRouter } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <NavBar />
        <Routes>
          <Route path="http://localhost:3000/" exact component={Login} />
          <Route path="/catalogo" exact component={Catalogo} />
          <Route path="/clientes" exact component={ListaDeClientes} />
          <Route path="/carrito" exact component={CarritoDeCompras} />
        </Routes>
      </BrowserRouter>
    );
  }
}

export default App;
